    <style>
    /* Panel (maximized by default) */
    #infoPanel {
        position: fixed;
        top: 0;
        right: 0;
        width: 75vw;            /* maximized width */
        height: 100vh;         /* full height */
        z-index: 10000;
        background: linear-gradient(135deg,#ffffff,#f7f7f7);
        border-left: 1px solid #ddd;
        box-shadow: -6px 0 18px rgba(0,0,0,0.18);
        display: none;         /* shown by JS */
        flex-direction: column;
        gap: 12px;
        padding: 15px;
        box-sizing: border-box;
        font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Arial;
        overflow: hidden;      /* content placed in #panel-content (scroll there) */
    }

    /* Minimized visual: compact bar like your old function */
    #infoPanel.minimized {
        position: absolute;
        top: 120px;
        right: 10px;
        width: 400px;
        max-width: 95vw;
        height: auto;
        padding: 12px;
        border-radius: 12px;
        box-shadow: 0 6px 18px rgba(0,0,0,0.2);
        overflow: visible;
    }

    /* Header (always visible even when scrolled) */
    #header-container {
        display:flex;
        align-items:center;
        justify-content: center;
        position: relative;
        font-size: 18px;
        font-weight: 700;
        color: #333;
        padding: 6px 0;
    }

    /* Controls (close / toggle) */
    #infoPanelToggle, #infoPanelClose {
        position: absolute;
        top: 10px;
        width: 28px;
        height: 28px;
        line-height: 26px;
        border-radius: 50%;
        text-align: center;
        cursor: pointer;
        background: rgba(255,255,255,0.95);
        color: #666;
        border: 1px solid rgba(0,0,0,0.06);
        box-shadow: 0 2px 5px rgba(0,0,0,0.08);
    }
    #infoPanelClose { right: 12px; }
    #infoPanelToggle { right: 44px; }
    #infoPanelClose:hover { background:#f44336; color:#fff; transform: rotate(18deg); }
    #infoPanelToggle:hover { background:#2f6fed; color:#fff; transform: translateY(-2px); }

    /* Panel content — this is what's hidden when minimized */
    #panel-content {
        display: flex;
        flex-direction: column;
        gap: 8px;
        height: calc(100% - 56px); /* leave space for header/control area */
        overflow-y: auto;          /* scrollable area for table + charts */
        padding-right: 6px;
        box-sizing: border-box;
    }

    /* Table */
    #table-container {
        flex: unset;
        max-height: none;
        overflow-y: visible;
        padding-bottom: 6px;
    }

    /* Plot container area */
    #plot-container {
        display: flex;
        flex-direction: column;
        gap: 8px;
        flex: 1 1 auto;
    }

    /* Tabs */
    .plot-tabs {
        display:flex;
        gap:6px;
        padding:8px;
        align-items:center;
        background: linear-gradient(#fafafa,#f5f5f5);
        border-bottom: 1px solid #eee;
        flex: 0 0 auto;
    }
    .plot-tab-btn {
        background: transparent;
        border: none;
        padding: 6px 10px;
        font-size: 13px;
        border-radius: 6px;
        cursor: pointer;
        color: #333;
    }
    .plot-tab-btn:hover { background:#f0f0f0; transform: translateY(-1px); }
    .plot-tab-btn.active { background:#2f6fed; color:#fff; box-shadow: 0 6px 20px rgba(47,111,237,0.12); }

    /* Plot content */
    .plot-content {
        display: none;
        width: 100%;
        flex: 1 1 auto;
        min-height: 0;
    }
    .plot-content.active {
        display: flex;
        flex-direction: column;
        min-height: 36vh;   /* generous default; adjust to taste */
        max-height: 80vh;
    }
    .plot-content > div,
    .plot-content .plotly-graph-div,
    .plot-content .js-plotly-plot {
        width: 100% !important;
        height: 100% !important;
        flex: 1 1 auto !important;
        min-height: 240px !important;
    }

    /* When minimized, hide the content wrapper completely */
    #infoPanel.minimized #panel-content { display: none; }

    /* Responsive */
    @media (max-width: 768px) {
        #infoPanel { width: 92vw; right:4vw; left:4vw; height: 92vh; top: 4vh; }
        #infoPanel.minimized { width: 92vw; right:4vw; left:4vw; top: 4vh; }
        .plot-content.active { min-height: 40vh; }
    }

        <!-- everything below is hidden when minimized -->
        <div id="panel-content" aria-hidden="false">

            <div id="plot-container" role="region" aria-label="Zones plots">

                    <button class="plot-tab-btn" data-tab="2" role="tab" aria-selected="false">Sales Trend Over Time</button>
                    <button class="plot-tab-btn" data-tab="3" role="tab" aria-selected="false">Cities Brand Share</button>
                </div>
                <div id="plot_div" class="plot-content active" role="tabpanel"></div>
                <div id="plot_div2" class="plot-content" role="tabpanel"></div>
                <div id="plot_div3" class="plot-content" role="tabpanel"></div>
            </div>
        </div>

    <script>
    (function(){
        // --- Utilities ---
        function ensurePlotly(cb) {
            if (window.Plotly) return cb();
            var s = document.createElement('script');
            s.src = 'https://cdn.plot.ly/plotly-latest.min.js';
            s.async = true;
            s.onload = cb;
            s.onerror = function(){ console.error('Failed to load Plotly'); cb(); };
            document.head.appendChild(s);
        }

        function findPlotRoot(container) {
            if (!container) return null;
            return container.querySelector('.js-plotly-plot') || container.querySelector('.plotly-graph-div') || null;
        }

        function safeResizePlotByElement(container) {
            if (!container || !window.Plotly) return;
            var plotRoot = findPlotRoot(container) || container;
            if (!plotRoot) return;
            if (plotRoot.offsetParent === null) return; // not visible
            var r = plotRoot.getBoundingClientRect();
            if (r.width <= 0 || r.height <= 0) return;
            try { Plotly.Plots.resize(plotRoot); }
            catch (err) { console.warn('Plotly resize failed', err); }
        }

        function safeResizeActivePlot() {
            if (!window.Plotly) return;
            try {
                var contents = Array.from(document.querySelectorAll('.plot-content'))
                    .filter(function(c){
                        if (c.classList.contains('active')) return true;
                        if (c.offsetParent !== null) return true;
                        var r = c.getBoundingClientRect();
                        return (r.width > 0 && r.height > 0);
                    });
                if (contents.length) { contents.forEach(function(c){ safeResizePlotByElement(c); }); return; }
                ['plot_div','plot_div2','plot_div3'].forEach(function(id){
                    var el = document.getElementById(id);
                    if (el) safeResizePlotByElement(el);
                });
            } catch (e) {
                console.warn('safeResizeActivePlot error', e);
            }
        }

        // Normalize / tweak figure prior to plotting
        function normalizeFig(fig, container) {
            var data = Array.isArray(fig && fig.data) ? JSON.parse(JSON.stringify(fig.data)) : (Array.isArray(fig) ? JSON.parse(JSON.stringify(fig)) : []);
            // pie tweaks
            data = data.map(function(t){
                if (!t) return t;
                var copy = JSON.parse(JSON.stringify(t));
                if (copy.type === 'pie' || copy['type'] === 'pie') {
                    if (!copy.textposition) copy.textposition = 'outside';
                    if (!copy.insidetextorientation) copy.insidetextorientation = 'radial';
                }
                return copy;
            });
            var layout = Object.assign({}, fig && fig.layout ? fig.layout : {});
            layout.margin = layout.margin || {l:50, r:16, t:40, b:48};
            var hasPie = data.some(function(t){ return t && (t.type === 'pie' || t['type'] === 'pie'); });
            if (hasPie) {
                layout.legend = Object.assign({orientation:'v', x:1.02, y:0.5}, layout.legend || {});
                layout.margin.r = Math.max(layout.margin.r || 16, 120);
            }
            // set pixel size from container so initial render is crisp
            try {
                var rect = container.getBoundingClientRect();
                if (rect.width > 20) layout.width = Math.round(rect.width);
                if (rect.height > 20) layout.height = Math.round(Math.max(rect.height, 240));
            } catch(e){}
            var config = (fig && fig.config) ? Object.assign({}, fig.config) : {};
            config.responsive = true;
            return {data: data, layout: layout, config: config};
        }

        // Render using the pattern you trust (double RAF + react/newPlot)
        function renderDataToPanel() {
            var tableEl = document.getElementById('table-container');
            if (tableEl && typeof main_map_table !== 'undefined') tableEl.innerHTML = main_map_table || '';

            var plots = (typeof main_map_plots !== 'undefined') ? main_map_plots : (window.main_map_plots || []);
            if (!plots || !plots.length) return;

            ensurePlotly(function(){
                requestAnimationFrame(function(){
                    requestAnimationFrame(function(){
                        ['plot_div','plot_div2','plot_div3'].forEach(function(id, idx){
                            try {
                                var container = document.getElementById(id);
                                var fig = plots[idx];
                                if (!container || !fig) return;
                                var norm = normalizeFig(fig, container);
                                var root = findPlotRoot(container);
                                var already = !!root;
                                if (already) {
                                    try { Plotly.react(container, norm.data, norm.layout, norm.config); }
                                    catch (e) { console.warn('Plotly.react failed, fallback newPlot', e); Plotly.newPlot(container, norm.data, norm.layout, norm.config); }
                                } else {
                                    Plotly.newPlot(container, norm.data, norm.layout, norm.config);
                                }
                            } catch (err) {
                                console.error('Plot render error for', id, err);
                            }
                        });
                        // after drawing, ensure visible plots are resized
                        requestAnimationFrame(function(){ requestAnimationFrame(safeResizeActivePlot); });
                    });
                });
            });
        }

        // Tab switcher
        function showPlotTab(index) {
            var i = Number(index) || 1;
            document.querySelectorAll('.plot-tab-btn').forEach(function(b, idx){
                var is = (idx === (i-1));
                b.classList.toggle('active', is);
                b.setAttribute('aria-selected', is ? 'true' : 'false');
            });
            document.querySelectorAll('.plot-content').forEach(function(c, idx){
                c.classList.toggle('active', idx === (i-1));
            });
            requestAnimationFrame(function(){ requestAnimationFrame(safeResizeActivePlot); });
        }

        // Show/hide/toggle behavior
        function showInfoPanel(){
            var p = document.getElementById('infoPanel');
            if (!p) return;
            p.style.display = 'flex';
            p.setAttribute('aria-hidden','false');
            // ensure panel-content visible (in case minimized previously)
            var content = document.getElementById('panel-content');
            if (content) { content.style.display = p.classList.contains('minimized') ? 'none' : 'flex'; content.setAttribute('aria-hidden', p.classList.contains('minimized') ? 'true' : 'false'); }
            renderDataToPanel();
            requestAnimationFrame(function(){ requestAnimationFrame(safeResizeActivePlot); });
        }
        function hideInfoPanel(){
            var p = document.getElementById('infoPanel');
            if (!p) return;
            p.style.display = 'none';
            p.setAttribute('aria-hidden','true');
        }
        function toggleMinimizePanel(){
            var p = document.getElementById('infoPanel');
            var content = document.getElementById('panel-content');
            var btn = document.getElementById('infoPanelToggle');
            if (!p || !content || !btn) return;
            var isMin = p.classList.toggle('minimized');
            if (isMin) {
                // hide content -> show compact header bar
                content.style.display = 'none';
                content.setAttribute('aria-hidden','true');
                btn.title = 'Maximize';
                btn.innerText = '⤢';
            } else {
                content.style.display = 'flex';
                content.setAttribute('aria-hidden','false');
                btn.title = 'Minimize';
                btn.innerText = '—';
                // re-render/resize now visible
                requestAnimationFrame(function(){ requestAnimationFrame(function(){ renderDataToPanel(); safeResizeActivePlot(); }); });
            }
        }

        // Wire up UI
        function initPanel() {
            var p = document.getElementById('infoPanel');
            if (!p) return false;

            // Close
            var closeBtn = document.getElementById('infoPanelClose');
            if (closeBtn) {
                closeBtn.onclick = hideInfoPanel;
                closeBtn.onkeyup = function(e){ if(e.key==='Enter' || e.key===' ') hideInfoPanel(); };
            }

            // Toggle minimize/maximize
            var tog = document.getElementById('infoPanelToggle');
            if (tog) {
                tog.onclick = toggleMinimizePanel;
                tog.onkeyup = function(e){ if(e.key==='Enter' || e.key===' ') toggleMinimizePanel(); };
            }

            // Tabs
            document.querySelectorAll('.plot-tab-btn').forEach(function(btn){
                btn.addEventListener('click', function(){ showPlotTab(this.getAttribute('data-tab')); });
                btn.addEventListener('keydown', function(e){ if(e.key==='Enter' || e.key===' ') { e.preventDefault(); showPlotTab(this.getAttribute('data-tab')); } });
            });

            // Window resize
            window.addEventListener('resize', function(){ requestAnimationFrame(function(){ requestAnimationFrame(safeResizeActivePlot); }); });

            // MutationObserver to react to class/style changes (extra safety)
            var moTarget = document.getElementById('infoPanel');
            if (moTarget) {
                var mo = new MutationObserver(function(muts){
                    muts.forEach(function(m){
                        if (m.type === 'attributes' && (m.attributeName === 'style' || m.attributeName === 'class')) {
                            requestAnimationFrame(function(){ requestAnimationFrame(safeResizeActivePlot); });
                        }
                    });
                });
                mo.observe(moTarget, { attributes: true, attributeFilter: ['style','class'] });
            }
            return true;
        }

        // Start when DOM ready
        function whenReady(fn) {
            if (document.readyState === 'loading') document.addEventListener('DOMContentLoaded', fn);
            else fn();
        }

        whenReady(function(){
            // populate table if available
            try {
                var t = document.getElementById('table-container');
                if (t && (typeof main_map_table !== 'undefined' || typeof window.main_map_table !== 'undefined')) {
                    t.innerHTML = (window.main_map_table || main_map_table || '');
                }
            } catch(e){ console.warn(e); }

            if (!initPanel()) {
                var tries = 0;
                var id = setInterval(function(){
                    if (initPanel()) { clearInterval(id); showInfoPanel(); }
                    tries++;
                    if (tries > 40) clearInterval(id);
                }, 120);
            } else {
                showInfoPanel();
            }
        });

        // Expose a few helpers
        window.showInfoPanel = showInfoPanel;
        window.hideInfoPanel = hideInfoPanel;
        window.toggleMinimizePanel = toggleMinimizePanel;
        window.renderZonesPlots = function(pls){ try { main_map_plots = pls; renderDataToPanel(); } catch(e){ console.warn(e); } };

    })();
    </script>
